import './css/App.css';
import React from 'react';
import Menu from './components/menu'
import Principal from './components/login/principal';

class App extends React.Component {
  constructor(props){
  super(props);
  this.state={
    usuario: true
  }
  }

  render(){
    return (
      this.state.usuario ? <div><Principal /></div> : <div><Menu user='1'/></div>
    );  
  } 
}


export default App;
